import styles from "./Header.module.css"
import logo from './assets/investment-calculator-logo';


const Header = () => {
    return (
        <header className={styles.header}>
            <img src={logo} alt="logo" />
            <h1>Investment Calculator</h1>
        </header>
    );
}

export default Header;
